	(00000006984,00000238,000001110,000000990,'Actively resists challenge and leaving comfort zone.'),
	(00000006985,00000238,000001111,000000990,'Unsettled by challenge and prefers to remain in comfort zone.'),
	(00000006986,00000238,000001112,000000990,'Open to challenge with encouragement and support. Prepared to be stretched.'),
