	(00000006992,00000238,000001113,000000991,'Accepts setbacks as a part of learning and growing. Is able to persevere. Self-motivation is consistent across activities.'),
	(00000006993,00000238,000001114,000000991,'Welcomes setbacks as inevitable to making progress and growing as a person. Highly self-motivated.'),
