	(00000007001,00000238,000001112,000000993,'Usually organized, given support and encouragement. Uses strategies to prioritize activities within and out of class, with general success.'),
	(00000007002,00000238,000001113,000000993,'Organised. Successful strategies to prioritize activities, within and out of class.'),
	(00000007003,00000238,000001114,000000993,'Highly organized. Flexible strategies to prioritize activities, within and out of class, and to anticipate change.'),
